import './App.css';


function App() {
  return (

    <div className="App">
      <header>
      <BrowserRouter>
      <nav>
        <NavLink activeClassName='nav-active' exact to="/"><span role="img">üè†</span> Home</NavLink>
        <p>Paragraph in nav</p>
        <NavLink activeClassName='nav-active' to="/react-hello-page-to-react">Create-React-App dzielimy na komponenty</NavLink> &nbsp;| &nbsp;
        <NavLink activeClassName='nav-active' to="/messages-root">MessagesRoot - dzielimy komponenty</NavLink> &nbsp;| &nbsp;
