        <NavLink activeClassName='nav-active' to="/jsx-conditions-user">User with conditions (JSX conditions)</NavLink> &nbsp;| &nbsp;
        <NavLink activeClassName='nav-active' to="/display-lists-in-react">Display lists in React</NavLink> &nbsp;| &nbsp;
      </nav>
      </BrowserRouter>
      </header>
    </div>
  );
}

export default App;
